window.bookSummaryJSON = "<p>Contains three complete, novel-length books in the Middle Falls Time Travel series.&nbsp;</p> <p><b><i>The Final Life of Nathaniel Moon </i></b></p> <p>Nathaniel is born with unimaginable powers and insight. When he tries to use his abilities to help the world, he and his family must go into hiding. In time, he is faced with an impossibly choice; reveal himself to the world, or let the unthinkable happen?&nbsp;</p> <p><b><i>The Emancipation of Veronica McAllister </i></b></p> <p>Veronica lived a quiet, almost-wasted life. When she died in 2018, she opened her eyes in her 18-year-old body in 1958 with all her memories intact. If you think you know what is coming, can you live your perfect life?</p> <p><b><i>The Changing Lives of Joe Hart</i></b></p> <p>Joe wants to make the world a better place. Stop John Lennon from being killed, do the same for his friends who died in the eruption of Mt. St. Helens. Before he can save others, he needs to save himself.</p>"; 
